Find the values of the parameter $\alpha\in\mathbb R$ for which the function $f\colon\mathbb R\to\mathbb R$ defined by
\[
f(x)=
\begin{cases}
\cos (x) + \frac{\tan (x)}{x} & \text{if $x> 0$,}\\
\alpha \log(\operatorname{e} -x ) &\text{if $x\le  0$,}
\end{cases}
\],
where $\log$ denotes the logarithm with base $e$, is continuous.

